import React, { Component } from 'react';
import { BrowserRouter as Router, Route, Link, Switch } from "react-router-dom";
import logo from './logo.svg';
import {getCookie, setCookie, randomStringValue, deleteCookie} from "./utils/cookieUtil";
import { SHOPPING_SESSION } from "./constants";
import Home from './pages/Home/Home'
import Header from './components/Header/Header'
import './App.css';

class App extends Component {

    componentDidMount() {
        if(getCookie(SHOPPING_SESSION)) {
            console.log(document.cookie)
        }
        else {
            let date = new Date;
            date.setDate(date.getDate() + 1);
            const options = {
                path: '/',
                expires: date
            };
            const cookieValue = randomStringValue();
            setCookie(SHOPPING_SESSION, cookieValue, options);
        }
    }

    render() {
    return (
        <Router>
          <>
              <Header/>
              <Home/>
          </>
        </Router>
    );
  }
}

export default App;
